	(1514, "Cintia Mariana Yañez ", 42, "", "2616520340", "44394949", "Barrio jardín trapiche ", "Godoy Cruz", "", "cama afuera (medio dia de mañana)", "Alrededor Godoy Cruz", "Si", "si", "Natalia Giovanni 2615375588. Si ella estuvo conmigo. Como tareas te cuento... yo tengo un peque que cuando yo no podia ella me lo cuidaba  siempre me hizo de comer  el tema de la limpieza y orden soy bastante quisquillosa con algunas cosas y cero problema  nunca tuve problemas. Pero bueno se complico porque tuve que viajar por trabajo  fue nada mas que por eso que se termino la relacion pero en realidad lo que es la limpieza  la comida y el cuidado de mi niño cuando yo tenia que viajar sin problema  no he tenido ningun inconveniente  fue una cuestion de movimientos mios por los que no pudimos seguir  Luciana Castro 2615967416  Si Cintia trabajo en mi casa hace unos años  trabajo por dos años  hacia tareas domesticas de todo tipo  muy prolija  si de confianza ella se quedaba en casa sola y a veces cuidaba a mi hijo me lo iba a buscar a la guarderia  si ella trabajo en casa y no tuve ningun inconveniente ", "2 años ", "Si", "Tareas del hogar y cuidado de niños ", "Muy bien", "Muy bien", "Muy bien", "Lasagna tartas bizcochuelos ", "Si", "Si", "Si", "Si", "Nueva", "", "No", "", 0000-00-00, "Normal"),
