	(2402, "Candela Daruich ", 22, "44308153", "2613906454", "2616013041 (Pareja)", "Mercedes V. 960", "Godoy Cruz", "", "Todo el dia / 8 horas", "Alrededor Godoy Cruz", "Si", "No", "Maria Agüero 2615003117  Hola si   esa chica trabajo conmigo   me cuido dos nietos mientras yo estaba operada   como ella es estudiante avanzada de maestra jardinera   sabe un monton   es muy honesta   esta siendo un poquito mas de su rol   como empleada dosmestica no trabajo   solo al cuidado de niños  y bastabte bien   muy conforme con ella   yo la recomiendo   esta trabajando con una amiga mia también a la que le esta cuidando también los nietos   y esta muy conforme   si hay que recomendarla   yo a ojos cerrados a esa chica Ella es de absoluta confianza nunca jamás me faltó nada...y como te digo no fue mi empleada doméstica fue cuidadora de niños...y en eso pocas son tan dedicadas y eficientes...atenta a todas las necesidades Dejo de trabajar x la carga horaria en la facultad...no le daban los tiempos   /// Agustina Altamirano 2615363583  candela trabajo conmigo hace un año y medio   yo luego me tuve que mudar mas lejos y le quedaba muy a tras mano es una chica muy buena   muy honesta   muy responsable   me ha ayudado muchísimo con mi hijo   las tareas de la casa   venia cuatro veces a la semana a limpiar y también solia cuidar a mi hijo   había varios días que venia a cuidarlo  es muy recomendable   no te toca nads   ni revisa nada  muy buena persona Si  yo le confíe mi casa y mi hijo con toda la tranquilidad  es muy atenta y siempre se mantiene en comunicación constante  trabajo 2 años conmigo y luego me mudé más lejos y ya no era accesible para ella la lejanía. Destaco mucho el cuidado que tiene con los niños  está por recibirse de la facultad creo y ama los niños  era muy atenta con mi hijo aún la recuerda con mucho cariño  además de que me dejaba impecable la casa siempre . /// Micaela Ortiz 2615383691  candela es muy responsable   ella fue la primera persona que contrate para que me limpiara el departamento   yo soy joven y sola   y a veces me daba desconfianza que alguien entrara a mi casa   es decir un desconocido pero no ella es muy amable  siempre esta disposición a todo lo que le decía   me ayudaba en toda la limpieza del departamento  Para mí sí es una persona de súper confianza  nunca me faltó nada  me cuidaba el departamento como si fuera de ella y limpiaba todo con la absoluta libertad  yo le dejé una copia de mis llaves y ella iba en un horario y se retiraba y nunca tuve ningún problema. Ella iba a limpiar siempre en la mañana   a las 8 o 9 llegaba y limpiaba unas 3 o 4 horas  4 veces a la semana  trataba de pagarle muy bien porque es excelente el trabajo que hace  limpiaba todos los pisos  los platos que dejaba sucios  me limpiaba y ordenaba mi pieza  limpiaba el balcón  y a veces le encargaba que me meta a lavar la ropa o planchar algunas prendas que necesitaba yo para el trabajo La conocí por medio de la mamá de una amiga que me la recomendó porque trabajaba también en la casa de ellas y les dejaba en perfectas condiciones la casa y yo necesitaba urgente a alguien Dejó de trabajar conmigo porque ella estaba estudiando en la universidad y los horarios se le comenzaron a complicar porque le dieron muchas materias y tuvo que dejarlo ", "5 años", "Si", "Tareas del hogar y cuidado de bebes", "Excelente", "Excelente", "Bien", "Ravioles con distintas salsas  pastel de papa  tartas de verduras", "Si", "Si", "Si", "Si", "Nueva", "", "No", "", 0000-00-00, "Normal"),
